(136, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/02/wordpress-4-4-2-security-and-maintenance-release/''>WordPress 4.4.2 Security and Maintenance Release</a> <span class="rss-date">February 2, 2016</span><div class="rssSummary">WordPress 4.4.2 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.4.1 and earlier are affected by two security issues: a possible SSRF for certain local URIs, reported by Ronni Skansing; and an open redirection attack, reported by Shailesh Suthar. Thank you [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://wptavern.com/shiny-updates-version-2-adds-functionality-for-themes-and-bulk-plugin-updates''>WPTavern: Shiny Updates Version 2 Adds Functionality for Themes and Bulk Plugin Updates</a></li><li><a class=''rsswidget'' href=''https://poststatus.com/a-day-of-rest-review/''>Post Status: The first WordPress REST API conference, in review</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/a-day-of-rest-conference-successful-81-would-attend-again''>WPTavern: A Day of REST Conference Successful, 81% Would Attend Again</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/siteorigin-panels/'' class=''dashboard-news-plugin-link''>Page Builder by SiteOrigin</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=siteorigin-panels&amp;_wpnonce=8f74eb1f01&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Page Builder by SiteOrigin''>Install</a>)</span></li></ul></div>', 'no'),
